INSERT INTO `newsfeed` (`id`, `content`, `created_at`, `title`, `image`, `excerpt`, `updated_at`, `units`, `fac_id`, `type`) VALUES
(1, '<h6><font face=\"Helvetica Neue\"><span class=\"s1\" style=\"font-kerning: none;\">Wambi is a reward and recognition system fueled by patient reviews to appreciate the incredible work you already do!</span></font>&nbsp;</h6><h6><font face=\"Helvetica Neue\"><span class=\"s1\" style=\"font-kerning: none;\">To get started:</span></font></h6><h6></h6><h6><font face=\"Helvetica Neue\">1. Watch this short&nbsp;training video to learn more about your dashboard and how to cash out your Pecks for Rewards!&nbsp;<span style=\"font-size: 11px;\"><br></span></font><font face=\"Helvetica Neue\">Password:&nbsp;<span class=\"\" style=\"background-color: rgb(255, 255, 0);\">wambicares</span></font></h6><h6><iframe src=\"https://player.vimeo.com/video/197926131\" width=\"640\" height=\"360\" frameborder=\"0\" webkitallowfullscreen=\"\" mozallowfullscreen=\"\" allowfullscreen=\"\"></iframe></h6><h6><p><a href=\"https://vimeo.com/197926131\">Wambi Employee Portal</a>&nbsp;from&nbsp;<a href=\"https://vimeo.com/wambi\">Wambi</a>&nbsp;on&nbsp;<a href=\"https://vimeo.com/\">Vimeo</a>.</p></h6><h6><font face=\"Helvetica Neue\">2. Click the circle on the top right of your dashboard, and select your name to&nbsp;confirm that your cell phone number and email address are up to date. if you would like you can also update your photo. Please know it will have to be approved by your manager. &nbsp;</font>&nbsp;&nbsp;</h6><h6><font face=\"Helvetica Neue\"><span class=\"s1\" style=\"font-kerning: none;\">We are excited for your participation in the program and would love your continual feedback. Please reach out to us anytime at&nbsp;<a href=\"mailto:info@wambi.org\"><span class=\"s2\" style=\"text-decoration-line: underline; font-kerning: none; color: rgb(5, 99, 193);\">info@wambi.org .&nbsp;<br></span></a></span></font><font face=\"Helvetica Neue\"><span class=\"s1\" style=\"font-kerning: none;\">&nbsp;<br></span></font><font face=\"Helvetica Neue\"><span class=\"s1\" style=\"font-kerning: none;\">All our best,<br></span></font><font face=\"Helvetica Neue\"><span class=\"s1\" style=\"font-kerning: none;\">The Wambi Team</span></font></h6><h6><font face=\"Helvetica Neue\"><span class=\"s1\" style=\"font-kerning: none;\"><font color=\"#0000ff\">P.S. Follow us on instagram:</font><font color=\"#9c00ff\">&nbsp;@wambicares&nbsp;</font></span></font></h6>', '2017-08-21 17:21:07', 'Getting Started with Wambi ', 'tm4-8.png', NULL, '2017-08-21 17:21:07', '[\"1\",\"2\",\"3\",\"5\",\"6\",\"7\",\"10\"]', '1', NULL),
(2, '<h3>Congratulationsto Theresa for receiving great feedback from her patients!<br>Here are two comments that were made by her patients:</h3><p><span style=\"color: rgb(121, 121, 121);\">\"Theresa has been a great RN and has been rounding often to make sure everything is great with my dad. She is a good listener and communicator as needs arise.\"</span></p><p>\"<span style=\"color: rgb(121, 121, 121);\">Very kind and caring. Made us feel that our fathers health and well-being was important to her and all staff. Thanks Theresa\"</span></p><p><br></p>', '2017-08-21 18:16:09', 'Spotlight \"RN\" of the week: Theresa N', 'Screen Shot 2017-08-21 at 2.12.40 PM.png', NULL, '2017-08-21 18:40:08', '[\"1\"]', '1', NULL),
(3, '<h3>Congratulationsto Vincent for receiving great feedback from his patients!<br>Here isa commentthat was made by one of his patients:</h3><p><span style=\"color: rgb(121, 121, 121);\">\"Vincent may be 67 but he is tireless at his job. He was with me straight for 2 days and nights. Whenever I called and he would come and help me to go to the restroom, get water, or anything really. He was cool!\"</span><br></p>', '2017-08-21 18:24:17', 'Spotlight \"CNA\" of the week: Vincent Y', 'Screen Shot 2017-08-21 at 2.20.12 PM.png', NULL, '2017-08-28 17:50:19', '[\"10\"]', '1', NULL),
(4, '<h3>Congratulations&nbsp;to Windy for receiving great feedback from his patients!<br>Here is&nbsp;a comment&nbsp;that was made by one of his patients:</h3><p><font color=\"#636363\">\"Windy is the best RN my father has had during his long two-week stay. He took the time to really listen to my father and promptly took care of his needs. He always has a smile on his face and is so pleasant. He never made my dad feel like he was too busy with other patients. He is so perfectly suited to this job and I hope he can be recognized officially for a job well done and who has far exceeded all expectations of a nurse.\"&nbsp;</font></p>', '2017-08-21 18:30:49', 'Spotlight \"RN\" of the week: Windy K!', 'Screen Shot 2017-08-21 at 2.30.28 PM.png', NULL, '2017-08-21 18:30:49', '[\"2\"]', '1', NULL),
(5, '<h3>Congratulations&nbsp;to Grace for receiving great feedback from her patients!<br>Here are two comments that were made by her patients:</h3><p><span style=\"color: rgb(121, 121, 121); background-color: rgb(255, 255, 255);\">\"She provided very comprehensive advice on what to expect before or after the heart valve surgery and made my dad at ease (comfortable) knowing he may be having a major surgery. She also seemed highly skilled and professional and know how to take care of the patient. We were very happy.\"</span></p><p><span style=\"color: rgb(121, 121, 121); background-color: rgb(255, 255, 255);\">\"She was very caring and did a wonderful job taking care of me.\"</span><span style=\"color: rgb(121, 121, 121); background-color: rgb(244, 248, 251);\"><br></span><br></p>', '2017-08-21 18:35:16', 'Spotlight \"RN\" of the week: Grace R!', 'Screen Shot 2017-08-21 at 2.34.57 PM.png', NULL, '2017-08-21 18:35:16', '[\"3\"]', '1', NULL),
(6, '<h3>Congratulationsto Amy for receiving great feedback from her patients and their loved ones!<br>Here are two comments that were made:</h3><p><span style=\"color: rgb(121, 121, 121);\">\"Amy was very sweet and patient with my grandma. She took her time to explain the exercises and her expectations.\"</span></p><p>\"<span style=\"color: rgb(121, 121, 121);\">She is well-versed in what she\'s doing. Does her job. Very punctual.\"</span></p><p><br></p><p><br></p><p><br></p>', '2017-08-21 18:41:55', 'Spotlight \"Physical Therapist\" of the week: Amy D!', 'Screen Shot 2017-08-21 at 2.41.33 PM.png', NULL, '2017-08-28 13:06:39', '[\"1\",\"2\",\"3\",\"5\",\"6\",\"7\",\"10\"]', '1', NULL),
(7, '<h3><font color=\"#797979\">Congratulations Roderick on receiving great feedback from your patients!<br></font><font color=\"#797979\">Here is a comment that was made:</font></h3><p><span style=\"color: rgb(121, 121, 121);\">\"He\'s got such a good disposition. He\'s polite and makes me feel very comfortable.\"</span><font color=\"#797979\"><span style=\"background-color: rgb(244, 248, 251);\"><br></span></font></p>', '2017-08-21 18:44:57', 'Spotlight \"CNA\" of the week: Roderick E!', 'Screen Shot 2017-08-21 at 2.43.54 PM.png', NULL, '2017-08-21 18:44:58', '[\"3\"]', '1', NULL),
(8, '<h3>Congratulations&nbsp;to Theresa for receiving great feedback from her patients!<br>Here is a comment that was made:</h3><p><span style=\"color: rgb(121, 121, 121);\">\"She greeted me with a warm smile and explained everything clearly. Much appreciation for her!\"</span><br></p>', '2017-08-21 18:47:13', 'Spotlight \"Radiology Tech\" of the week: Theresa H', 'Screen Shot 2017-08-21 at 2.45.46 PM.png', NULL, '2017-08-21 18:47:14', '[\"1\",\"2\",\"3\",\"5\",\"6\",\"7\",\"10\"]', '1', NULL),
(9, '<h3>Congratulations&nbsp;to Cariza for receiving great feedback from her patients!<br>Here are two comments that were made by her patients:</h3><p><span style=\"color: rgb(121, 121, 121);\">\"Thank you for your patience, understanding, gentleness, kindness and most importantly listening to my concerns and needs!\"</span></p><p><span style=\"color: rgb(121, 121, 121);\">\"</span><span style=\"color: rgb(121, 121, 121);\">GREAT!\"</span></p><p><b style=\"background-color: rgb(255, 255, 255);\"><font color=\"#636363\">Keep up the amazing work Cariza!</font></b></p>', '2017-08-21 18:50:26', 'Spotlight \"RN\" of the week: Cariza I!', 'Screen Shot 2017-08-21 at 2.50.07 PM.png', NULL, '2017-08-21 18:50:26', '[\"5\"]', '1', NULL),
(10, '<h3>Congratulations&nbsp;to Vanessa for receiving great feedback from her patients!<br>Here is a comment that was made:</h3><p>\"<span style=\"color: rgb(121, 121, 121);\">Vanessa is one loving and caring person, I love her as my nurse assistance. She was very sweet and always patient with me.\"</span></p><p><b><font color=\"#636363\">Keep up the fantastic work Vanessa!</font></b></p>', '2017-08-21 18:59:21', 'Spotlight \"CNA\" of the week: Vanessa V!', 'Screen Shot 2017-08-21 at 2.59.01 PM.png', NULL, '2017-08-21 18:59:21', '[\"5\"]', '1', NULL),
(11, '<h3>Congratulations&nbsp;to Adriana for receiving great feedback from her patients and their loved ones!<br></h3><h3><br>Here is a comment that was made:&nbsp;</h3><p><span style=\"color: rgb(121, 121, 121);\">\"Went above and beyond what is in her job description. Very empathic and very very very friendly. Could not ask for a better person as a caregiver.\"</span></p><p><span style=\"color: rgb(121, 121, 121);\"><b style=\"background-color: rgb(255, 255, 255);\">Keep up the great work Adriana!</b><br></span><br></p>', '2017-08-28 13:06:32', 'Spotlight \"CNA\" of the week: Adriana S', 'Adriana_Saucedo_007054.jpg', NULL, '2017-08-28 13:06:32', '[\"7\"]', '1', NULL),
(12, '<h3 style=\"margin-top:0pt;margin-bottom:0pt;margin-left:0in;text-align:left;\r\ndirection:ltr;unicode-bidi:embed;mso-line-break-override:none;word-break:normal;\r\npunctuation-wrap:hanging\"><font face=\"Verdana\" color=\"#636363\"><b><span style=\"font-size: 12pt;\">Congrats\r\nto Mirtha for going above and beyond!</span></b></font></h3><h3 style=\"margin-top:0pt;margin-bottom:0pt;margin-left:0in;text-align:left;\r\ndirection:ltr;unicode-bidi:embed;mso-line-break-override:none;word-break:normal;\r\npunctuation-wrap:hanging\"><font face=\"Verdana\" color=\"#636363\"><b><span style=\"font-size: 12pt;\"><br></span><span style=\"font-size: 12pt; font-style: normal;\">\r\nComment from a patient/family:</span></b></font></h3><p><span style=\"color: rgb(121, 121, 121); background-color: rgb(255, 255, 255);\">\"Mirtha was very caring, very helpful my first night on the floor. She came and checked on me often, helped me out when I needed it and provided quality care and genuine concern for her patients.\"</span></p><p><span style=\"color: rgb(121, 121, 121); background-color: rgb(255, 255, 255);\"><br></span></p><p><font face=\"Verdana\" color=\"#636363\">Keep up the fantastic work Mirtha!</font></p><p><br></p>', '2017-08-28 13:11:28', 'Spotlight \"RN\" of the week: Mirtha A', 'Mirtha_Akin_005050.jpg', NULL, '2017-08-31 06:04:52', '[\"10\"]', '1', NULL),
(13, '<h3 style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Verdana\" color=\"#636363\"><span style=\"font-weight: 600;\"><span style=\"font-size: 12pt;\">Congrats to Ericka for going above and beyond!&nbsp;</span></span></font></h3><h3 style=\"margin-top: 0pt; margin-bottom: 0pt; margin-left: 0in; direction: ltr; unicode-bidi: embed; word-break: normal;\"><font face=\"Verdana\" color=\"#636363\"><span style=\"font-weight: 600;\"><span style=\"font-size: 12pt;\"><br></span><span style=\"font-size: 12pt;\">Comment from a patient/family:</span></span></font></h3><p><span style=\"color: rgb(121, 121, 121);\">\"My father ne</span><span style=\"color: rgb(121, 121, 121);\">ver had such good care as he had here. Ericka always has a smile on her face and always listens to his needs.\"</span></p><p><font face=\"Verdana\" color=\"#636363\">Keep up the fantastic work Ericka!</font></p><div><font face=\"Verdana\" color=\"#636363\"><br></font></div>', '2017-09-06 02:07:03', 'Spotlight \"RN\" of the week: Ericka M', 'Ericka_Mendez_011388.jpg', NULL, '2017-09-06 02:07:03', '[\"10\"]', '1', NULL),
(14, '<h3>Congratulations&nbsp;to Lilia for receiving great feedback from her patients!<br>This is what they said:</h3><p><span style=\"color: rgb(121, 121, 121);\">\"Lilia was very loving and caring!!\"</span></p><p><span style=\"color: rgb(121, 121, 121);\">\"Lilia has been an amazing CNA and made me very happy.\"</span></p>', '2017-09-06 02:11:14', 'Spotlight \"CNA\" of the week: Lilia G', 'Lilia_Garcia_008054.jpg', NULL, '2017-09-06 02:11:14', '[\"10\"]', '1', NULL),
(15, '<h3>Congratulations&nbsp;to Kathy for receiving great feedback from her patients!<br>Here are two comments that were made by her patients:</h3><p><span style=\"color: rgb(121, 121, 121);\">\"Kathy is very professional and a very nice nurse\"</span></p><p><span style=\"color: rgb(121, 121, 121);\">\"Kathy is great, thank you!\"&nbsp;</span></p>', '2017-09-06 02:14:06', 'Spotlight \"LVN\" of the week: Kathy J', 'kathy', NULL, '2017-09-06 02:14:06', '[\"7\"]', '1', NULL),
(16, '<h3><font face=\"Helvetica\">Congratulations&nbsp;to Kevern for receiving great feedback from her patients!<br>Here is&nbsp;a comment&nbsp;that was made by one of her patients:</font></h3><h3><span style=\"color: rgb(121, 121, 121);\"><font face=\"Helvetica\"><b>\"Kevern did a great job. She was information, caring, and extremely delightful!\"</b></font></span></h3>', '2017-09-06 02:17:53', 'Spotlight \"RN\" of the week: Kevern M', 'Kevern_Mccarthy_003099.jpg', NULL, '2017-09-06 02:17:53', '[\"7\"]', '1', NULL),
(17, '<h3>Congratulations&nbsp;to Brian for receiving great feedback from his patients!<br>Here are two comments that were made:</h3><h3><span style=\"color: rgb(121, 121, 121);\">\"I truly appreciate Brian\'s friendliness.\"<br></span><span style=\"color: rgb(121, 121, 121);\">\"He went above and beyond and provided the ultimate customer service. Thank you, Brian!\"</span></h3>', '2017-09-06 02:22:01', 'Spotlight \"RN\" of the week: Brian Angelo D', 'Brian Angelo_Delos Reyes_011392.jpg', NULL, '2017-09-06 02:22:01', '[\"5\"]', '1', NULL),
(18, '<h4>Congratulations&nbsp;to Mike for receiving great feedback from his patients!<br>Here is&nbsp;a comment&nbsp;that was made by one of his patients:</h4><h4><span style=\"color: rgb(121, 121, 121);\"><b>\"Mike is great and a good good man.\"</b></span></h4><h4><span style=\"color: rgb(121, 121, 121);\"><b>\"He is a friendly and caring person who always knows what he is talking about.\"</b></span></h4>', '2017-09-06 02:29:01', 'Spotlight \"RN\" of the week: Mike M', 'Mike_Makshanoff_007918.jpg', NULL, '2017-09-06 02:29:01', '[\"3\"]', '1', NULL),
(19, '<h3>Congratulations&nbsp;to Sofia for receiving great feedback from her patients!<br><h3>Here is&nbsp;a comment&nbsp;that was made by one of his patients:</h3></h3><h4><span style=\"color: rgb(121, 121, 121);\"><b>\"She was very nice and friendly and was able to always provide what I needed.\"</b></span></h4>', '2017-09-06 02:31:26', 'Spotlight \"CNA\" of the week: Sofia S', 'Sofia_Shahoian_007055.jpg', NULL, '2017-09-06 02:31:26', '[\"3\"]', '1', NULL),
(20, '<h4>Congratulationsto Lucina for receiving great feedback from her patients!<br>Here are two comments that were made by her patients:</h4><p><font color=\"#636363\"><b>\"Lucina is the best in her position. She is caring, and professional and always saw to every need my father had. She was very pleasant mannered and loving toward the patient and friendly with the family. She made sure every comfort measure was supplied at my dad\'s request, with never the role of her eyes or huff of disgust, which was greatly appreciated by us, his family. She deserves recognition for a job very well done, and then some!\"</b></font></p><p><font color=\"#636363\"><b>\"She is a very good worker, an asset to the hospital, and has such a positive attitude.\"</b></font></p>', '2017-09-06 02:41:36', 'Spotlight \"CNA\" of the week: Lucina', 'Lucina_Betancourt_007557.jpg', NULL, '2017-09-06 02:41:49', '[\"2\"]', '1', NULL),
(21, '<h3>Congratulations&nbsp;to Ericka for receiving great feedback from her patients!<br>Here are two comments that were made:</h3><h4><b>\"She\'s very informative and took time to answer any questions we have. She was also very patient and compassionate. We appreciate her!\"</b></h4><h4><b><br>\"Best nurse with compassion!!\"</b></h4>', '2017-09-06 02:46:42', 'Spotlight \"RN\" of the week: Ericka C', 'Ericka_Castellanos_008585.jpg', NULL, '2017-09-06 02:46:43', '[\"1\"]', '1', NULL),
(22, '<h3>Welcome aboard matey! We appreciate having you aboard our ship.&nbsp;</h3><p>-The 5North Crew</p>', '2017-09-07 18:34:50', 'Welcome Francis D to 5North! ', 'Screen Shot 2017-09-07 at 12.36.26 PM.png', NULL, '2017-09-07 18:35:24', '[\"3\"]', '1', NULL),
(23, '<h3>Congratulations&nbsp;to Angela for receiving great feedback from her patients!<br><br></h3><h4>\"I\'ve been in multiple hospitals this year, she is the best nurse out of all the hospitals I\'ve been in. She went above and beyond her call of Duty. She is superior to all nurses I have dealt with in 6 different hospitals. Thank you for the great care.\"&nbsp;<br></h4>', '2017-09-13 14:58:59', 'Spotlight \"RN\" of the week: Angela M', 'angela.jpg', NULL, '2017-09-13 14:58:59', '[\"1\"]', '1', NULL),
(24, '<h4>Congratulations&nbsp;to Stephen for receiving great feedback from his patients!</h4><h4><span style=\"background-color: rgb(255, 255, 255);\">\"<span style=\"color: rgb(121, 121, 121); font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">He was very proactive and really went the extra mile for me.\"</span></span><br></h4>', '2017-09-13 15:04:07', 'Spotlight \"RN\" of the week: Stephen E', 'Stephen_Espiritu_010622.jpg', NULL, '2017-09-13 15:04:07', '[\"2\"]', '1', NULL),
(25, '<h4>Congratulations&nbsp;to Carlos for receiving great feedback from his patients!<br></h4><p><b><font face=\"Arial Black\" style=\"background-color: rgb(255, 255, 255);\" color=\"#636363\">\"Very nice guy and prompt. Don\'t change.\"&nbsp;<br></font></b></p><p><b><font face=\"Arial Black\" style=\"background-color: rgb(255, 255, 255);\" color=\"#636363\">\"Very polite!\"</font></b></p><p>Keep up the great work Carlos!</p>', '2017-09-13 15:07:32', 'Spotlight \"CNA\" of the week: Carlos O', 'carlos.png', NULL, '2017-09-13 15:07:33', '[\"3\"]', '1', NULL),
(26, '<p><span style=\"color: rgb(80, 84, 88); font-family: &quot;Source Sans Pro&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 18px;\">Congratulations&nbsp;to Christian for receiving great feedback from his patients!</span><br></p><p><font color=\"#636363\"><span style=\"font-weight: 600;\">\"</span></font><span style=\"background-color: rgb(244, 248, 251); color: rgb(121, 121, 121);\">Very personable and easy to talk with. Very attentive. Thank you Christian!\"</span></p>', '2017-09-13 15:14:40', 'Spotlight \"RN\" of the week: Christian D', 'Christian_De Leon_009710.jpg', NULL, '2017-09-13 15:14:40', '[\"5\"]', '1', NULL),
(27, '<h4>Congratulations&nbsp;to Rosa for receiving great feedback from her patients!<br></h4><p>\"Very helpful and kind!\"</p>', '2017-09-13 15:17:57', 'Spotlight \"RN\" of the week: Rosa F', 'Rosa_Feng_007440.jpg', NULL, '2017-09-13 15:17:58', '[\"7\"]', '1', NULL),
(28, '<h4>Congratulations&nbsp;to Lindsay for receiving great feedback from her patients!</h4><h4>\"<span style=\"color: rgb(121, 121, 121); font-family: &quot;Noto Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; background-color: rgb(244, 248, 251);\">Great service here made everything so much easier!</span>\"<br></h4><p><font color=\"#636363\"><span style=\"font-weight: 600;\">\"</span></font><span style=\"color: rgb(121, 121, 121); background-color: rgb(244, 248, 251);\">Very patient &amp; very caring</span><font color=\"#636363\"><span style=\"font-weight: 600;\">\"</span></font></p><p><font color=\"#636363\"><span style=\"font-weight: 600;\"><br></span></font></p>', '2017-09-13 15:20:26', 'Spotlight \"RN\" of the week: Lindsay E', 'LINDSAY_ELLIOTT_009892.jpg', NULL, '2017-09-13 15:20:26', '[\"10\"]', '1', NULL);
